let url = '';

switch(IRC.command.params[0]) {
  case 'en':
    url += 'https://www.dict.cc';
    break;
  
  default:
    url += 'https://en'+IRC.command.params[0]+'.dict.cc';
}

getDOM(url + '?s=' + encodeURIComponent(input))
.then(dom => {
    const list = dom.qsa('td.td7nl');
    Array.from({ length: IRC.command.params[1] || 1 }, (q, i) => {
        const index = (i + (IRC.command.params[1] || 0)) * 2;
        print(`${_.get(list, `[${index}].textContent`, '')} <> ${_.get(list, `[${index + 1}].textContent`, '').replace(/^\d+/, '')}`)
    });
}).catch(print.error)
